package com.koso.triplogger.dbimport androidx.lifecycle.LiveDataimport androidx.room.Daoimport androidx.room.Insertimport androidx.room.OnConflictStrategyimport androidx.room.Query@Daointerface DataSetRawDao{    @Query("SELECT * from triplogger_dataset_table ORDER BY milisecfromstart DESC")    fun getAll(): LiveData<List<DataSetRaw>>    @Query("SELECT * from triplogger_dataset_table ORDER BY milisecfromstart DESC")    suspend fun getAllSuspend(): List<DataSetRaw>    @Insert(onConflict = OnConflictStrategy.REPLACE)    suspend fun insert(dataSetRaw: DataSetRaw)    @Query("DELETE FROM triplogger_dataset_table")    suspend fun deleteAll()}